import React, { Component } from 'react';
import "../../Css/Register.css"
import { connect } from 'react-redux';


 class Project extends Component {
      constructor() {
      super();
      this.state = ({
        project: ""
      });
    }
    render() {

         const projectData = this.props.project.map(pro =>(
             <tr key={pro._id}>
                 <td>{pro.projectTitle}</td>
                 <td>{pro.projectDescrption}</td>
                 <td>{pro.projectSkills}</td>
                 <td>{pro.projectBudget}</td>
             </tr>
         ));
        return (
            <div>
             <table>
                 <thead>
                     <tr>
                         <th>projectTitle</th>
                          <th>projectDescrption</th>
                           <th>projectSkills</th>
                            <th>projectBudget</th>
                     </tr>
                    
                         {projectData}
                    
                 </thead>
             </table>
            </div>
        )
    }
}

const mapStateToProps = (state) => ({
  auth: state.auth,
  project: state.errors
});
export default connect(mapStateToProps,  null )(Project);
